query ArticleTemplate(
  $id: String!
) {
  strapiArticle(id: {eq: $id}) {
    title
    content
    image {
      childImageSharp {
        fixed(width: 200, height: 125) {
          ...GatsbyImageSharpFixed
        }
      }
    }
    author {
      id
      username
    }
  }
}

fragment GatsbyImageSharpFixed on ImageSharpFixed {
  base64
  width
  height
  src
  srcSet
}

